import React from "react";
import Data from "../data.json";

function Card() {
  console.log(Data);
  return (
    <div className="bg-red-900 rounded-xl w-[50%] mx-auto flex mt-[12%] text-center">
      <div className="bg-green-200 w-[50%]">
        <h1>Your Result</h1>
        <section>
          <p>76</p>
          <p>of 100</p>
        </section>
        <h2>Great</h2>
        <p>
          You scored higher than 65% of the people who have taken these tests.
        </p>
      </div>
      <div className="bg-yellow-200 w-[50%]">
        {Data.map((item, key) => {
          return (
            <div key={key} className="flex my-5 justify-center">
              <img src={item.icon} alt={item.category} />
              <p className="mx-4">{item.category}</p>
              <p>{item.score}/100</p>
            </div>
          );
        })}
        <button className="rounded-xl w-[50%] text-white bg-purple-500 my-5">
          Continue
        </button>
      </div>
    </div>
  );
}

export default Card;
